import React, { Component } from "react";

export default class SignUp extends Component {
    
    constructor(props) {
        super(props);
        this.UserType = "";
    }
    
    checkIfStudent(e) {
        e.preventDefault();
        this.UserType = "student";
    }
    checkIfTeacher(e) {
        e.preventDefault();
        this.UserType = "teacher";  
    }

    render() {
        
    }



}
